    // Test addRewards function
    function addRewards(uint256 seed, uint256 amount) public {
        address rewardToken;
        if (seed % 2 == 0) {
            rewardToken = address(token1);
        } else {
            rewardToken = address(token2);
        }
        uint256 distributionRewardAmountBefore =
